import React from 'react';

export default function Logo({ collapsed }) {
  return (
    <div className="flex items-center space-x-3">
      <div className="relative">
        <svg width="40" height="40" viewBox="0 0 40 40" fill="none" xmlns="http://www.w3.org/2000/svg">
          <circle cx="20" cy="20" r="20" fill="#2563eb" />
          <rect x="10" y="12" width="20" height="16" rx="4" fill="#fbbf24" />
          <rect x="16" y="16" width="8" height="8" rx="2" fill="#fff" />
        </svg>
      </div>
      {!collapsed && (
        <span className="text-2xl font-bold gradient-text select-none">CollegeApp</span>
      )}
    </div>
  );
}
